  assert.teststr(R.mod(R.mknum("48"), R.mknum("24")), "0");
  assert.teststr(R.mod(R.mknum("-5"), R.mknum("2")), "1");
  
  assert.teststr(R.modPow(R.mknum("7"), R.mknum("723"), R.mknum("13")), "5");
